import { combineReducers } from 'redux'
//import hehehh from 'hehehhheh'
// import songListReducer from './song_list_reducer'
// import songSelectReducer from './song_select_reducer'

const songListReducer = () => {
  return [
    {title: 'This is cool', length: 5, artist: 'Lisa'},
    {title: 'This sucks', length: 4, artist: 'Bob'},
    {title: 'Wait a sec', length: 3.5, artist: 'Someone'},
    {title: 'Nvm', length: 10, artist: 'Lulz'}
  ]
}

const songSelectReducer = (state = null, action) => {
  if (action.type === 'SELECT_SONG') {
    return action.payload
  }
  return state
}

const rootReducer = combineReducers({
  songList: songListReducer,
  selectedSong: songSelectReducer
})

export default rootReducer
